import React, { Component } from "react";
import "../App.css";

const Home = (props) => {
  const itemList = this.props.state.items.map((item) => (
  <li>{item.name}</li>
  ));
  return(
    <div>
      {itemList}
    </div>
  )
}





export default Home;
